import React, {Component} from 'react';
import '../Styles/Navigation.scss';

export default class Navigation extends Component {
  constructor() {
    super();
    this.state = {}
  }
  render() {
    return(
      <nav className="header__nav">
        <h1 className="nav__title">Quiz Quest</h1>
        <ul>
          <li>
            <button className="nav__btn nav__btn--home">
              <i class="fas fa-home"></i></button></li>
          <li><button className="nav__btn nav__btn--learn"><i class="fas fa-brain"></i></button></li>
          <li><button className="nav__btn nav__btn--quiz"><i class="fas fa-pen-square"></i></button></li>
          <li>
            <button className="nav__btn nav__btn--review">
              <i class="fas fa-clipboard-list"></i>
            </button>
          </li>
        </ul>
      </nav>
    )
  }
}
